void sklepSeqStep::clicked (const ModifierKeys &modifiers)
{
	Button::clicked (modifiers);

	if (modifiers.isPopupMenu() && !modifiers.isShiftDown())
	{
		popup		= true;
		quickPop	= false;
	}
	else if (modifiers.isRightButtonDown() && modifiers.isShiftDown())
	{
		popup		= false;
		quickPop	= true;
	}
	else
	{
		popup		= false;
		quickPop	= false;

		if (getToggleState())
		{
			Logger::writeToLog (T("toggle on"));
			setOn();
		}
		else
		{
			Logger::writeToLog (T("toggle off"));
			setOff();
		}
	}
}

int sklepSeqStep::getIndex ()
{
	return (index);
}

